      </div>
    <style jsx>{`
        .fc-wrapper {
          display: flex;
          align-items: center;
          justify-content: center;
        }

        .fc {
          margin: auto;
          width: 173px;
          height: 86px;
          background: black;
        }
      `}</style>
    </div>
  )
}
